import React from "react";
import { View, Text, StyleSheet, TouchableOpacity} from "react-native";
import Feather from "react-native-vector-icons/Feather";


export default function ListarPets({ data, deleteItem, editItem, props}) {
    return (
        <View style={styles.container}>
            <Text style={styles.text}>ID: {props.data.id}</Text>
            <Text style={styles.text}>Protetor: {data.protetor}</Text>
            <Text style={styles.text}>Tipo: {data.tipo}</Text>
            <Text style={styles.text}>Nome: {data.nome}</Text>
            <Text style={styles.text}>Porte: {data.porte}</Text>
            <Text style={styles.text}>Ra√ßa: {data.raca}</Text>
            <Text style={styles.text}>Idade: {data.idade}</Text>

            <TouchableOpacity style={{marginRight:10}} onPress={()=> deleteItem(data.id)}>
                <Feather name="trash" color="#fff" size={20}/>
            </TouchableOpacity>

            <TouchableOpacity style={{marginRight:10}} onPress={()=> editItem(data.id)}>
                <Feather name="edit" color="#fff" size={20}/>
            </TouchableOpacity>

        </View>


    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1, marginTop: 10,
        marginBottom: 5,
        padding: 10,
        backgroundColor: '#121212'


    },
    text: {
        color: '#FFF', fontSize: 17

    }
});
